    super ()
    this.state = {
      robots: robots,
      searchfield: ''
    }
  }
  render(){
    return (
    <div className='tc'>
    <h1>RoboFriends</h1>
    <SearchBox />
    <Cardlist robots={robots}/>
    </div>
    );
  }
}

